import './App.css';
import Jumbotron from 'react-bootstrap/Button';

function Layout() {
  return (
    <div className="App">
      <header className="App-header">
        <Jumbotron>
          <h1>Member Login</h1>
        </Jumbotron> 
      </header>
    </div>
  );
}

export default Layout;
